INSERT INTO `course` VALUES (5,'The New History of the World by J. M. Roberts\r\n- [is probably the best single volume,history of the world out there. I own several editions of this book.]\r\n\r\nThe Story of Civilization by Will and Ariel Durant\r\n-is an eleven-volume (12 if you count The Story of Philosophy, which the set I have includes) to covers the wide-breath of history.\r\nIt is a little out of date now. The last volume was published in 1975, and Durant passed away in 1981.\r\n\r\nThe 100: A Ranking of the Most Influential Persons in History by Michael Hart\r\n- is an interesting book. It is a list of 100 short (~ 3-10 page) biographies of who the author believes are the most influential persons from human history. He ranks Mohammad at #1.\r\n\r\nThe Military 100: A Ranking of the Most Influential Leaders of All Time by Lt. Col Michael Lee Lanning\r\n-is a similar ranking of military leaders from world history.\r\n\r\nIn Search of the Indo-Europeans: Language, Archaeology, and Myth by J. P. Mallory\r\n-is very good. English, Latin, Greek, Russian, Farsi (Iranian), Hindi, etc. are all closely related. Understanding the origins of the worlds largest language family is important.\r\n','World history','1','acad34fa-22e4-47de-8cc3-db957913fdd7'),(6,'Algebra and Trigonometry with Analytic Geometry by E. Swokowski.\r\n-This latest edition in the highly respected Swokowski/Cole precalculus series retains the elements that have made it so popular with instructors and students alike: its exposition is clear, the time-tested exercise\r\n sets feature a variety of applications, its uncluttered layout is appealing, and the difficulty level of problems is appropriate and consistent.\r\n\r\nAbel\'s Theorem in Problems and Solutions: Based on the Lectures of Professor V.I. Arnold\r\n-Do formulas exist for the solution to algebraical equations in one variable of any degree like the formulas for quadratic equations?\r\n  The main aim of this book is to give new geometrical proof of Abel\'s theorem, as proposed by Professor V.I. Arnold.\r\n\r\nIntroduction To Commutative Algebra\r\n-This book grew out of a course of lectures given to third year undergraduates at Oxford University and it has the modest aim of producing a rapid introduction to the subject.\r\n It is designed to be read by students who have had a first elementary course in general algebra.\r\n\r\n Linear Representations of Finite Groups by Jean-Pierre Serre\r\n -This book consists of three parts, rather different in level and purpose: The first part was originally written for quantum chemists. It describes the correspondence, due to Frobenius, between linear representations and charac- ters.\r\n This is a fundamental result, of constant use in mathematics as well as in quantum chemistry or physics.\r\n','Algebra','2','acad34fa-22e4-47de-8cc3-db957913fdd7'),(7,'Chemistry by Steven S. Zumdahl,  Susan A. Zumdahl\r\n-Authors Steven and Susan Zumdahl offer all the elements instructors need for their general chemistry course. They bring a conceptual approach\r\nto chemistry and integrate problem-solving skills throughout, helping students transition from theory to practice.\r\n\r\nOrganic Chemistry by Jonathan Clayden,  Nick Greeves, Stuart Warren, Peter Wothers\r\n-This new and innovative text helps students develop a deeper understanding of organic chemistry. It treats the subject as a coherent whole, complete with numerous logical connections, consequences, and an underlying structure and \"language.\"\r\n\r\nGeneral Chemistry by Linus Pauling\r\nWhen it was first published, this first-year chemistry text revolutionized the teaching of chemistry by presenting it in terms of unifying principles instead of as a body of unrelated facts. Those principles included modern theories of atomic and molecular structure, quantum mechanics, statistical mechanics and thermodynamics','All aroung chemistry','3','acad34fa-22e4-47de-8cc3-db957913fdd7'),(8,'The Disappearing Spoon: And Other True Tales of Madness, Love, and the History of the World from the Periodic Table of the Elements\r\n-Why did Gandhi hate iodine (I, 53)? Why did the Japanese kill Godzilla with missiles made of cadmium (Cd, 48)? How did radium (Ra, 88) nearly ruin Marie Curie\'s reputation? And why did tellurium (Te, 52) lead to the most bizarre gold rush in history?\r\n\r\nElements: A Visual Exploration of Every Known Atom in the Universe (Hardcover)\r\n-An eye-opening, original collection of gorgeous, never-before-seen photographic representations of the 118 elements in the periodic table.\r\n\r\nPeriodic Tales: The Curious Lives of the Elements by Hugh Aldersey-Williams\r\n-Everything is made of them, from the furthest reaches of the universe to this book that you hold in your hands, including you. Like you, the elements have lives: personalities and attitudes, talents and shortcomings, stories rich with meaning.\r\nYou may think of them as the inscrutable letters of the periodic table but you know them much better than you realise.\r\n\r\nStuff Matters: Exploring the Marvelous Materials That Shape Our Man-Made World by Mark Miodownik\r\n-Why is glass see-through? What makes elastic stretchy? Why does a paper clip bend? Why does any material look and behave the way it does? These are the sorts of questions that Mark Miodownik is constantly asking himself. A globally-renowned materials scientist, Miodownik has spent his life exploring objects\r\n as ordinary as an envelope and as unexpected as concrete cloth, uncovering the fascinating secrets that hold together our physical world.','Chemistry The Central Science','3','c2b23777-25c2-4970-bcb4-8bc615abd052'),(9,'China occupies a unique place in our modern world for the continuity of its history and culture. Get in touch from prehistoric times to the present. These books follow its development\r\n from the rise of Confucianism, Buddhism, and the great imperial dynasties to the Mongol, Manchu, and Western intrusions\r\n  and the modern communist state. Experience phenomenal--embracing Chinese arts, culture, economics, society and its treatment\r\n  of women, foreign policy, emigration, and politics, including the key uprisings of 1919 and 1989 in Tiananmen Square.\r\n\r\n\r\nThis Is China: The First 5,000 Years by Haiwang Yuan:\r\n-This should be the standard text in every introductory class to Chinese history. It is an incredibly short, brief book that is a crash course on Chinese history to the uninitiated as well as a solid quick reference for the more experienced. It is a work that runs over the surface of almost everything Chinese history has to offer and dips its head under the water at select places to try to give the reader a real taste of what lies before them. More than cover Chinese history, it is a great book to illustrate the fact that trying to understand all of Chinese history at once is impossible and is as much art and dynamic dialogue as it is inexact science and lively academia. Another must have.\r\n\r\nA History of Chinese Civilization by Jacques Gernet:\r\n-A readable and detailed survey of Chinese history that is notable for not prejudicing modern history over earlier periods. It heavily focuses on intellectual and cultural history, and at times the details of the political history get ignored, but any survey this ambitious must make cuts. The account of the nineteenth century is particularly vivid.\r\n\r\n\r\nCambridge Illustrated History of China by Patricia Buckley Ebrey (2nd ed. 2010).\r\n- Incredibly beautiful. Don\'t let the visuals fool you into thinking this is a glorified picture book. It is a masterpiece of clear concise writing, tying together dates, places, and names so that they clarify events instead of overwhelming the reader. The images themselves are not only beautifully rendered but also masterfully picked so that they enhance the text, rather than detract from it. Finally, the author pays special attention to possible Western biases or misconceptions and handles them gracefully. This is the general reference book to get that is as enjoyable to read as it is informative as well as academically rigorous in its methodology.\r\n\r\nChinese Civilization: A Sourcebook edited by Patricia Buckley Ebrey.\r\n- Another standard find in intro Chinese history courses in college.\r\n\r\nA Short History of China: From Ancient Dynasties to Economic Powerhouse By Gordon Kerr.\r\n-Soldiers of the Dragon edited by CJ Peers. Osprey publishers have a wide variety of awesome military histories. You wouldn\'t be likely to find this in a college classroom, but that can be a plus. It\'s not a hard read, but extremely informative.\r\n','China through ages','1','c2b23777-25c2-4970-bcb4-8bc615abd052'),(10,'This course provides an elementary introduction to probability and statistics with applications. Topics include: basic combinatorics, random variables, probability distributions, Bayesian inference, hypothesis testing, confidence intervals, and linear regression.\r\n\r\n Introduction to probabillity models by Sheldon M. Ross\r\n-Is the primary text for a first undergraduate course in applied probability. This updated edition of Ross\'s classic\r\nbestseller provides an introduction to elementary probability theory and stochastic processes, and shows how probability theory can be applied to the study of phenomena in fields such as engineering, computer science, management science, the physical and social sciences, and operations research. With the addition of several new sections relating to actuaries, this text is highly recommended by the Society of Actuaries.\r\n\r\nAn Intermediate Course in Probability by Allan Gut\r\n-The purpose of this text is to provide the reader with a solid background and understanding of the basic results and methods in probability theory before entering into more advanced courses. The first six chapters focus on the central areas of probability:\r\nmultivariate random variables; conditioning; transforms; order variables; the multivariate normal distribution; and convergence.\r\n\r\nExercises in Probability by T. Cacoullos\r\n-The author, the founder of the Greek Statistical Institute, has based this book on the two volumes of his Greek edition which has been used by over ten thousand students during the past fifteen years.\r\nIt can serve as a companion text for an introductory or intermediate level probability course.','Statistics and probabillity','2','c2b23777-25c2-4970-bcb4-8bc615abd052'),(11,'Chronicle of the Maya Kings and Queens by Martin and Grube\r\n-Behind immense, ruined cities, and abandoned artworks deep in the rainforests of Central America lie the turbulent stories of the Maya monarchy. This text examines 11 of the most important Maya kingdoms, and provides biographical accounts of the 152 kings and 4 ruling queens. The authors set out the latest thinking on the nature of Maya divine kingship, statehood, and political authority, and describe recent readings and archaeological finds. All royal names are spelt out in hieroglyphs, and datafiles listing lineage, spouses and children, and place of burial are included.\r\n\r\nA Forest of Kings: The Untold Story of the Ancient Maya by David Friedel and Linda Schele.\r\n-ecent interpretation of Maya hieroglyphs has given the 1st written history of the New World as it existed before the European invasion. In this book, two of the 1st central figures in the effort to decode the glyphs, Linda Schele & David Freidel, detail this history. A Forest of Kings is the story of Maya kingship, from the beginning of its institution & the 1st great pyramid builders 2000 years ago to the decline of Maya civilization & its destruction by the Spanish. Here the great rulers of pre-Columbian civilization come to life again with the decipherment of their writing. At its height, Maya civilization flourished under great kings like Shield-Jaguar, who ruled for over 60 years, expanding his kingdom & building some of the most impressive works of architecture in the ancient world. Long placed on a mist-shrouded pedestal as austere, peaceful stargazers, Maya elites are now known to have been the rulers of populous, aggressive city-states.\r\n\r\nAztec Warfare: Imperial Expansion and Political Control by Ross Hassig.\r\n-In exploring the pattern and methods of Aztec expansion, Ross Hassig focuses on political and economic factors. Because they lacked numerical superiority, faced logistical problems presented by the terrain, and competed with agriculture for manpower, the Aztecs relied as much on threats and the image of power as on military might to subdue enemies and hold them in their orbit. Hassig describes the role of war in the everyday life of the capital, Tenochtitlan: the place of the military in Aztec society; the education and training of young warriors; the organization of the army; the use of weapons and armor; and the nature of combat.\r\n\r\n1491: New Revelations of the Americas Before Columbus by Charles C. Mann (Available on CD.)\r\n-In this groundbreaking work of science, history, and archaeology, Charles C. Mann radically alters our understanding of the Americas before the arrival of Columbus in 1492.\r\nContrary to what so many Americans learn in school, the pre-Columbian Indians were not sparsely settled in a pristine wilderness; rather, there were huge numbers of Indians who actively molded and influe\r\n\r\n*Empire of the Summer Moon by S.C Gwynne (Also available on CD.)\r\n-In the tradition of Bury My Heart at Wounded Knee, a stunningly vivid historical account of the forty-year battle between Comanche Indians and white settlers for control of the American West, centering on Quanah, the greatest Comanche chief of them all.\r\n\r\n*Canada\'s First Nations: A History of Founding Peoples from Earliest Times by Olive Dickason and David T. McNab\r\n-This is a comprehensive history of Canada\'s original inhabitants-- Indians, Inuit, and later, Metis. Using an interdisciplinary approach that combines history, anthropology, and archaeology, Dickason tells the story of the more than 50 nations in the territory that is now Canada, beginning with the arrival of people in North America from across the Bering Strait \r\n*American Holocaust: The Conquest of the New World by David E. Stannard','Native American History','1','265172ad-713f-4638-bd8c-a75727ac1db2');
